function json_parse(s){var t=window.JSON;if(t&&t.parse)try{return t.parse(s)}catch(x){return null}t=s.replace(/"([^"\\]|\\["\\\/bfnrt]|\\u\d{4})*"/g,"S").replace(/(-?[1-9]*\d)(\.\d+)?([eE][+-]?\d+)?/g,"A").replace(/(true|false|null)/g,"A").replace(/\s/g,""),p;do{p=t;t=t.replace(/\[([SAC](,[SAC])*)?\]/g,"C").replace(/{(S:[SAC](,S:[SAC])*)?}/g,"C")}while(p!=t&&t!="C");return t=="C"?eval("("+s+")"):null}
